import React, { PureComponent } from "react";
import Head from "next/head";
import { Line } from "@ant-design/plots";

import AppLayout from "../components/AppLayout";
const data = [
  { year: "1991", value: 3 },
  { year: "1992", value: 4 },
  { year: "1993", value: 3.5 },
  { year: "1994", value: 5 },
  { year: "1995", value: 4.9 },
  { year: "1996", value: 6 },
  { year: "1997", value: 7 },
  { year: "1998", value: 9 },
  { year: "1999", value: 13 },
];
const Profile = () => {
  const config = {
    data,
    xField: "year",
    yField: "value",
    point: {
      shapeField: "square",
      sizeField: 4,
    },
    interaction: {
      tooltip: {
        marker: false,
      },
    },
    style: {
      lineWidth: 2,
    },
  };

  return (
    <AppLayout>
      <Head>
        <title>NTB</title>
      </Head>
      <div>운동</div>
      <Line {...config} />
    </AppLayout>
  );
};

export default Profile;
